import React,{Component} from 'react';

class About extends Component{
    render(){
        return (
            <div id='about'>
                <div className='container container1'>
                    <div>
                        <img src='/image/team.jpg' alt='team' style={{width:'60vw'}}></img>
                    </div>
                </div>      

            </div>
        )
    }
}

export default About;
